import React from 'react';
import { Card, Typography } from '@mui/material';
import { Box, Container } from '@mui/system';
import { useNavigate } from 'react-router-dom';


const CardFoodType = () => {
    const navigate = useNavigate();
    return (
        <Box
        sx={{
            width: '200px',
            height: '186px',
            justifyContent: 'center',
            alignItems: 'center'
        }}
        onClick={() => navigate('/listmenukelas')}>
            <Box
            component='img'
            src = './junkfood.svg'
            width = '200px'
            height = '133px'
            />
            <Typography
            fontWeight={400}
            fontSize='24px'
            mt='24px'
            textAlign='center'
            color='black'
            >
                Junkfood
            </Typography>
        </Box>
    )
}

const ListFoodType = () => {
  return (
    <Box sx={{
        justifyContent: 'center',
        alignItems: 'center',
        mb: '147px'
    }}>
        <Container 
        justifyContent='center'
        sx={{ width:'872px', marginTop: '95px',justifyContent: 'center', alignItems: 'center'}}>
            <Typography fontSize='32px' color='primary' fontWeight={600} textAlign='center'>
            More food type as you can choose
            </Typography>

            <Container
            sx={{
              gap: '24px',
              marginTop: '80px',
              display: 'grid',
              gridTemplateColumns: 'repeat(4, 1fr)',
              rowGap: '60px',
              justifyContent: 'center',
              alignItems: 'center',

            }} >
                <CardFoodType/>
                <CardFoodType/>
                <CardFoodType/>
                <CardFoodType/>
                <CardFoodType/>
                <CardFoodType/>
                <CardFoodType/>
                <CardFoodType/>

            </Container>
        </Container>
    </Box>
  )
}

export default ListFoodType
